import { Circle } from 'react-konva'
import Konva from 'konva'
import { useState } from 'react';


function Shape() {
  const [color, setColor] = useState()

    return (
        <Circle
          x={123}
          y={123}
          draggable
          radius={50}
          fill={color}
          onDragEnd={() => {
            setColor(Konva.Util.getRandomColor());
          }}
        />
    )
}

export default Shape
